package com.active.bean;import java.io.Serializable;/** * 这是一个类说明 * * @author ta * @date 2019/8/18 下午9:04 * @since 1.0 */public class RoadExportDriverInfo implements Serializable {    private String name;    private String mobile;    private String provinceName;    private String cityName;    private String delaerSortName;    private String carModal;    private String appointTime;    private String areaCode;    private String phoneNum;    private String createTime;    public String getName() {        return name;    }    public void setName(String name) {        this.name = name;    }    public String getMobile() {        return mobile;    }    public void setMobile(String mobile) {        this.mobile = mobile;    }    public String getProvinceName() {        return provinceName;    }    public void setProvinceName(String provinceName) {        this.provinceName = provinceName;    }    public String getCityName() {        return cityName;    }    public void setCityName(String cityName) {        this.cityName = cityName;    }    public String getDelaerSortName() {        return delaerSortName;    }    public void setDelaerSortName(String delaerSortName) {        this.delaerSortName = delaerSortName;    }    public String getCarModal() {        return carModal;    }    public void setCarModal(String carModal) {        this.carModal = carModal;    }    public String getAppointTime() {        return appointTime;    }    public void setAppointTime(String appointTime) {        this.appointTime = appointTime;    }    public String getAreaCode() {        return areaCode;    }    public void setAreaCode(String areaCode) {        this.areaCode = areaCode;    }    public String getPhoneNum() {        return phoneNum;    }    public void setPhoneNum(String phoneNum) {        this.phoneNum = phoneNum;    }    public String getCreateTime() {        return createTime;    }    public void setCreateTime(String createTime) {        this.createTime = createTime;    }}